import React from "react";

import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import Toolbar from "react-minimalist-toolbar";
import { ProgressBar, Button } from "react-bootstrap";
import ServerTable from "react-strap-table";

function Exams() {
  const url = "https://react-strap-table.com/users";
  const columns = ["id", "name", "email", "created_at"];
  const options = {
    headings: { id: "#", created_at: "Created At" },
    sortable: ["name", "email"],
  };
  const exams = [
    {
      id: 1,
      text: "oftalmoloski",
      date: "11.11.2011.",
      time: "11.15",
      room: "11",
      physician: "physician",
    },
    { id: 2, text: "ginekoloski" },
    3,
    4,
  ];
  const listItems = exams.map((exams) => (
    <li key={exams.id}>
      {exams.text}
      {exams.id}
      {exams.date}
      {exams.time}
      {exams.physician}
      {exams.room}
    </li>
  ));
  return (
    <div className="App">
      <div className="App-home">
        <Toolbar logo={logo} brand="InfoKC" className="toolbar"></Toolbar>
        <p></p>
        <p></p>
        <p className="App-p">Slobodni termini</p>
        <div bgColor="transparent" className="Div-vertical">
          <ServerTable columns={columns} url={url} bordered>
            {function (row, column) {
              switch (column) {
                case "id":
                  return <input key={row.id} type="checkbox" value={row.id} />;
                case "avatar":
                  return <img src={row.avatar} className="table-image" />;
                default:
                  return row[column];
              }
            }}
          </ServerTable>
        </div>
      </div>
    </div>
  );
}
export default Exams;
